// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./TokenA.sol";
import "./TokenB.sol";

interface IToken {
    function transferFrom(address _from, address _to, uint256 _amount) external;
    function transfer(address _to, uint256 _amount) external;
    function balanceOf(address _user) external view returns(uint256);
}

contract Vault {

    address private immutable _tokenA;
    address private immutable _tokenB;
    
    mapping(address => mapping (address => uint256)) tokenBalances;

    /* Without interfaces.

        constructor(address tokenA, address tokenB) {
            _tokenA = tokenA;
            _tokenB = tokenB;
        }

        function depositToken(address _tokenAddress, uint256 _amount) external {
            if(_tokenAddress == _tokenA)
                TokenA(_tokenAddress).transferWithAllowance(msg.sender, address(this), _amount);
            else if(_tokenAddress == _tokenB)
                TokenB(_tokenAddress).transferFrom(msg.sender, address(this), _amount);
            else
                revert("Invalid token");
        }

        function withdrawToken(address _tokenAddress, uint256 _amount) external {
            
        }

        function getBalanceOf(address _user, address _tokenAddress) external view returns(uint256) {
            if(_tokenAddress == _tokenA)
                return TokenA(_tokenAddress).getBalance(_user);
            else if(_tokenAddress == _tokenB)
                return TokenB(_tokenAddress).balanceOf(_user);
            else
                return 0;
        }
    */

    function depositToken(IToken _token, uint256 _amount) external {
        _token.transferFrom(msg.sender, address(this), _amount);
    }

    function getBalanceOf(address _user, IToken _token) external view returns(uint256) {
        return _token.balanceOf(_user);
    }

}

contracts/TokenB.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TokenB {

    uint256 constant private OWNER_BALANCE = 1000 * 10 ** 18;
    mapping (address => uint256) balances;
    mapping (address => mapping(address => uint256)) allowances; // Allower -> Allowee -> Amount

    event TransferTo(address indexed _to, uint256 _amount);

    constructor() {
        balances[msg.sender] = OWNER_BALANCE;
    }

    function transfer(address _recipient, uint256 _amount) external {
        require(_recipient != address(0), "TRANSFER_TO_ZERO");
        require(balances[msg.sender] >= _amount, "INSUFFICENT_BALANCE");

        balances[msg.sender] -= _amount;
        balances[_recipient] += _amount;

        emit TransferTo(_recipient, _amount);
    }

    function transferFrom(address _from, address _to, uint256 _amount) external {
        require(_to != address(0), "TRANSFER_TO_ZERO");
        require(allowances[_from][msg.sender] >= _amount, "INSUFFICENT_ALLOWANCE");
        require(balances[_from] >= _amount, "INSUFFICENT_BALANCE");

        allowances[_from][msg.sender] -= _amount;
        balances[_from] -= _amount;
        balances[_to] += _amount;
    }

    function increaseAllowance(address _recipient, uint256 _amount) external {
        require(_recipient != address(0), "AUTHORIZE_TO_ZERO");

        allowances[msg.sender][_recipient] += _amount;
    }

    function decreaseAllowance(address _recipient, uint256 _amount) external {
        require(_recipient != address(0), "AUTHORIZE_TO_ZERO");

        allowances[msg.sender][_recipient] -= _amount;
    }

    function balanceOf(address user) external view returns(uint256) {
        return balances[user];
    }

}

contracts/TokenA.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TokenA {

    uint256 constant private OWNER_BALANCE = 1000 * 10 ** 18;
    mapping (address => uint256) balances;
    mapping (address => mapping(address => uint256)) allowances; // Allower -> Allowee -> Amount

    event Transfer(address indexed _from, address indexed _to, uint256 _amount);

    constructor() {
        balances[msg.sender] = OWNER_BALANCE;
    }

    function transferTo(address _recipient, uint256 _amount) external {
        require(_recipient != address(0), "TRANSFER_TO_ZERO");
        require(balances[msg.sender] >= _amount, "INSUFFICENT_BALANCE");

        balances[msg.sender] -= _amount;
        balances[_recipient] += _amount;

        emit Transfer(msg.sender, _recipient, _amount);
    }

    function transferWithAllowance(address _from, address _to, uint256 _amount) external {
        require(_to != address(0), "TRANSFER_TO_ZERO");
        require(allowances[_from][msg.sender] >= _amount, "INSUFFICENT_ALLOWANCE");
        require(balances[_from] >= _amount, "INSUFFICENT_BALANCE");

        allowances[_from][msg.sender] -= _amount;
        balances[_from] -= _amount;
        balances[_to] += _amount;
    }

    function increaseAllowance(address _recipient, uint256 _amount) external {
        require(_recipient != address(0), "AUTHORIZE_TO_ZERO");

        allowances[msg.sender][_recipient] += _amount;
    }

    function decreaseAllowance(address _recipient, uint256 _amount) external {
        require(_recipient != address(0), "AUTHORIZE_TO_ZERO");

        allowances[msg.sender][_recipient] -= _amount;
    }

    function getBalance(address user) external view returns(uint256) {
        return balances[user];
    }

}

